import "./HomePage.css";
import React from "react";
import Button from "./components/Button.js";

function HomePage() {
	return (
		<>
			<div className="homepage-container">
				{button && <Button buttonStyle="btn--outline">Sign up</Button>}
			</div>
		</>
	);
}

export default HomePage;
